import React from "react"

export default class Table extends React.Component{
    render(){
        return (
            <>
                <p className="topic">درباره این اقامتگاه در شیراز، نزویک شاه چراغ</p>
                <table style={{width:"100%"}}>
                    {this.props.tableItems.map((item, index) => {
                        return (
                            <tr key={index}>
                                <th>{item.topic}</th>
                                <td>{item.status}</td>
                            </tr>
                        )
                    })}
                </table>
            </>
        )
    }
}
